Ext.data.JsonP['AMPLIFY_Appcelerator_Services_FAQ']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>AMPLIFY Appcelerator Services FAQ</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n\t\t<div id=\"banner\" class=\"confbox admonition admonition-note aui-message warning shadowed information-macro\">\n\t\t\t<p>You can now find Appcelerator documentation at <a href=\"https://docs.axway.com/\" target=\"_blank\">https://docs.axway.com/</a>. This site will be taken down in the near future.</p>\n\t\t</div>\n        <div class=\"header\"/>\n\n        <div id=\"src-51251946\" class=\"content\">\n                        <h1>AMPLIFY Appcelerator Services FAQ</h1>\n    <div class=\"section section-2 \" id=\"src-51251946_safe-id-QU1QTElGWUFwcGNlbGVyYXRvclNlcnZpY2VzRkFRLVNpbmdsZUV2ZW50RnVubmVsaW5BcHBjZWxlcmF0b3JBbmFseXRpY3N3b24ndHdvcms\">\n        <h2 class=\"heading \"><span>Single Event Funnel in Appcelerator Analytics won&apos;t work</span></h2>\n    <p>You must use at least two events.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-51251946_safe-id-QU1QTElGWUFwcGNlbGVyYXRvclNlcnZpY2VzRkFRLVdoZXJlY2FuSWZpbmRteW9yZ2FuaXphdGlvbklEZm9yVGVzdD8\">\n        <h2 class=\"heading \"><span>Where can I find my organization ID for Test?</span></h2>\n    <p>You can locate your organization ID in the My Profile screen in Appcelerator Dashboard or inside the project&apos;s <tt class=\" \">tiapp.xml</tt> file in Appcelerator Studio.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-51251946_safe-id-QU1QTElGWUFwcGNlbGVyYXRvclNlcnZpY2VzRkFRLUhvd2RvSWludGVncmF0ZUFwcGNlbGVyYXRvclRlc3R3aXRoSmVua2lucz8\">\n        <h2 class=\"heading \"><span>How do I integrate Appcelerator Test with Jenkins?</span></h2>\n    <p>See <a class=\"document-link \" href=\"#!/guide/Integrating_Test_with_Jenkins\">Integrating Test with Jenkins</a> for details.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-51251946_safe-id-QU1QTElGWUFwcGNlbGVyYXRvclNlcnZpY2VzRkFRLUFwcGNlbGVyYXRvclRlc3RlcnJvcjpDYW5ub3RvcGVucGFnZShpT1Mp\">\n        <h2 class=\"heading \"><span>Appcelerator Test error: Cannot open page (iOS)</span></h2>\n    <p>See <a class=\"document-link \" href=\"#!/guide/Troubleshooting_problems_with_Test-section-src-43298705_safe-id-VHJvdWJsZXNob290aW5ncHJvYmxlbXN3aXRoVGVzdC1DYW5ub3RPcGVuUGFnZShpT1Mpb3JGYWlsZWR0b2xhdW5jaGFwcChBbmRyb2lkKQ\">Troubleshooting problems with Test</a> for details on how to correct this error.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-51251946_safe-id-QU1QTElGWUFwcGNlbGVyYXRvclNlcnZpY2VzRkFRLUFwcGNlbGVyYXRvclRlc3RlcnJvcjpGYWlsZWR0b2xhdW5jaGFwcChBbmRyb2lkKQ\">\n        <h2 class=\"heading \"><span>Appcelerator Test error: Failed to launch app (Android)</span></h2>\n    <p>See <a class=\"document-link \" href=\"#!/guide/Troubleshooting_problems_with_Test-section-src-43298705_safe-id-VHJvdWJsZXNob290aW5ncHJvYmxlbXN3aXRoVGVzdC1DYW5ub3RPcGVuUGFnZShpT1Mpb3JGYWlsZWR0b2xhdW5jaGFwcChBbmRyb2lkKQ\">Troubleshooting problems with Test</a> for details on how to correct this error.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-51251946_safe-id-QU1QTElGWUFwcGNlbGVyYXRvclNlcnZpY2VzRkFRLVRlc3RkYXNoYm9hcmRkb2Vzbm90bG9hZCgiU2VydmVyaGFzZW5jb3VudGVyZWRlcnJvci5QbGVhc2V0cnlhZ2Fpbm9yY29udGFjdHN1cHBvcnQiKQ\">\n        <h2 class=\"heading \"><span>Test dashboard does not load (&quot;Server has encountered error. Please try again or contact support&quot;)</span></h2>\n    <p>See <a class=\"document-link \" href=\"#!/guide/Troubleshooting_problems_with_Test-section-src-43298705_safe-id-VHJvdWJsZXNob290aW5ncHJvYmxlbXN3aXRoVGVzdC1UZXN0ZGFzaGJvYXJkZG9lc25vdGxvYWQoJnF1b3Q7U2VydmVyaGFzZW5jb3VudGVyZWRlcnJvci5QbGVhc2V0cnlhZ2Fpbm9yY29udGFjdHN1cHBvcnQmcXVvdDsp\">Troubleshooting problems with Test</a> for details on how to correct this error.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-51251946_AMPLIFYAppceleratorServicesFAQ-CLITroubleshooting\">\n        <h2 class=\"heading \"><span>CLI Troubleshooting</span></h2>\n    <div class=\"section section-3 \" id=\"src-51251946_AMPLIFYAppceleratorServicesFAQ-ApplicationdoesnotSpecifyaCFBundleExecutable\">\n        <h3 class=\"heading \"><span>Application does not Specify a CFBundleExecutable</span></h3>\n    <p>This error can occur when installing an iOS app bundle that has been dynamically instrumented for testing after compilation.    </p>\n    <p>    <img src=\"images/download/attachments/43298734/error-cfbundleexec.png\" alt=\"images/download/attachments/43298734/error-cfbundleexec.png\" class=\"confluence-embedded-image confluence-content-image-border\" width=\"392\" height=\"148\">\n        </img></p>\n    <p>As a workaround you can &quot;statically&quot; instrument the Xcode project, compile the project, and then install app bundle to the device. For steps on statically instrumenting an Xcode project, see the <a class=\"document-link unresolved\" href=\"#!/guide/AMPLIFY_Appcelerator_Services_FAQ-section-src-51251946\">iOS Project</a>   example.    </p>\n    </div>\n    <div class=\"section section-3 \" id=\"src-51251946_AMPLIFYAppceleratorServicesFAQ-ResourceNotFound\">\n        <h3 class=\"heading \"><span>Resource Not Found</span></h3>\n    <p>If you receive the following error:    </p>\n    <div class=\"confbox programlisting defaultnew syntaxhighlighter scroll-html-formatted-code\">\n                <div xmlns=\"http://www.w3.org/1999/xhtml\" class=\"defaultnew syntaxhighlighter scroll-html-formatted-code\">\n<div class=\"line\"><code class=\"plain\">com.appcelerator.mattwrapper.rest.RESTException: Error executing GET request! Received error code: </code><code class=\"value\">404</code></div>\n<div class=\"line\"><code class=\"plain\">{</code><code class=\"string\">&quot;success&quot;</code><code class=\"plain\">:</code><code class=\"keyword\">false</code><code class=\"plain\">,</code><code class=\"string\">&quot;description&quot;</code><code class=\"plain\">:</code><code class=\"string\">&quot;Resource Not Found&quot;</code><code class=\"plain\">,</code><code class=\"string\">&quot;code&quot;</code><code class=\"plain\">:</code><code class=\"value\">404</code><code class=\"plain\">}</code></div>\n</div>\n    </div>\n    <p>Make sure the <tt class=\" \">appkey</tt> parameter is correct.    </p>\n    </div>\n    <div class=\"section section-3 \" id=\"src-51251946_safe-id-QU1QTElGWUFwcGNlbGVyYXRvclNlcnZpY2VzRkFRLUZhaWxzd2l0aCJqYXZhLmxhbmcuT3V0T2ZNZW1vcnlFcnJvcjpKYXZhaGVhcHNwYWNlIndoZW50YXJnZXRpbmdhbkFQS2ZpbGU\">\n        <h3 class=\"heading \"><span>Fails with &quot;java.lang.OutOfMemoryError: Java heap space&quot; when targeting an APK file</span></h3>\n    <p>Add the <tt class=\" \">-Xmx2g</tt> option to the Java command to increase the JVM heap size.    </p>\n    <div class=\"confbox programlisting defaultnew syntaxhighlighter scroll-html-formatted-code\">\n                <div xmlns=\"http://www.w3.org/1999/xhtml\" class=\"defaultnew syntaxhighlighter scroll-html-formatted-code\">\n<div class=\"line\"><code class=\"plain\">java -Xmx2g -jar appcelerator-test.jar -apk ~/Documents/Eclipse_Workspace/SampleProject/SampleProject.apk -androidsdk ~/opts/android-sdk/ -appkey </code><code class=\"string\">&quot;11111111-2222-3333-4444-555555555555&quot;</code><code class=\"plain\"> -dashboardurl https:</code><code class=\"comments\">//platform.appcelerator.com -username user@appcelerator.com -password secret</code></div>\n</div>\n    </div>\n    </div>\n    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=51251946\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"AMPLIFY Appcelerator Services FAQ"});